import{_ as t,E as n,c as o,J as i,m as e,a as r,ab as s,o as c}from"./chunks/framework.CUflZczI.js";const v=JSON.parse('{"title":"Path Planning Interface","description":"","frontmatter":{},"headers":[],"relativePath":"en/computer_vision/path_planning_interface.md","filePath":"en/computer_vision/path_planning_interface.md"}'),p={name:"en/computer_vision/path_planning_interface.md"},l=e("h1",{id:"path-planning-interface",tabindex:"-1"},[r("Path Planning Interface "),e("a",{class:"header-anchor",href:"#path-planning-interface","aria-label":'Permalink to "Path Planning Interface"'},"â€‹")],-1),d=s('<div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>The <strong>Path Planning Interface</strong>, along with the features <strong>Obstacle avoidance in Missions</strong> and <strong>Safe Landing</strong> are no longer supported or maintained, and <em>should not</em> be used in any PX4 version.</p><p>This code was abandoned due to architectural constraints of the implementation making it hard to maintain, extend, and adopt. Support has been withdrawn make it clear that this interface is untested.</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>PX4 is now adopting more generic and scalable approaches for integrating these kinds of features. For example the <a href="./../ros2/px4_ros2_interface_lib.html">PX4 ROS 2 Interface Library</a> allows complete replacement of PX4 flight modes with enhanced versions written using ROS 2.</p></div><p>This interface allows PX4 to stream a proposed path to a companion computer, and receive back a stream of setpoints that more safely achieves the emitted path, or a mirror of the same stream if the path planning software does not support planning for the current PX4 mode. This enables features such obstacle avoidance in missions and safer landing to be provided by a planner on a companion computer.</p><p>This actual code is still present in code at time of writing (PX4 v1.15). Information about the API and associated features can be found in the <a href="https://docs.px4.io/v1.14/en/computer_vision/path_planning_interface.html" target="_blank" rel="noreferrer">PX4 v1.14 docs</a>.</p>',4);function h(m,f,_,g,u,P){const a=n("Badge");return c(),o("div",null,[l,i(a,{type:"warning",text:"Removed"}),d])}const w=t(p,[["render",h]]);export{v as __pageData,w as default};
